 return <h1>Hello {prop.name}, I am method 1</h1>;
}

const Hello = (props) => {
  return(<p>Hello! {props.name}, I am method {props.num}</p>)

}



function App() {
  const now = new Date()
  const a = 10
  const b = 16
  console.log("hello! I'm from the component")
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

        <div>
          <Welcome name="Joana"/>
          <Welcome name="Lilly"/>
          <Hello name="James" num="2"/>
          <Hello name="Dave" num="2"/>
